import React from 'react';
import './App.css';
import {BrowserRouter, Routes, Route} from "react-router-dom";
import NavBar from "./modules/layout/components/navbar/NavBar";
import Home from "./modules/layout/components/home/Home";
import ContactsAdmin from "./modules/contacts/components/admin/ContactsAdmin";
import AddContact from "./modules/contacts/components/add-contact/AddContact";
import EditContact from "./modules/contacts/components/edit-contact/EditContact";
import ViewContact from "./modules/contacts/components/view-contact/ViewContact";
import About from "./modules/layout/components/about/About";
import NotFound from "./modules/util/components/not-found/NotFound";

function App() {

    return (
        <React.Fragment>
            <BrowserRouter>
                <Routes>
                    <Route path={'/'} element={<Home/>}/>
                    <Route path={'/contacts/admin'} element={<ContactsAdmin/>}/>
                    <Route path={'/contacts/add'} element={<AddContact/>}/>
                    <Route path={'/contacts/edit/:contactId'} element={<EditContact/>}/>
                    <Route path={'/contacts/view/:contactId'} element={<ViewContact/>}/>
                    <Route path={'/about'} element={<About/>}/>
                    <Route path={'*'} element={<NotFound/>}/>
                </Routes>
            </BrowserRouter>
        </React.Fragment>
    );
}

export default App;
